(183, 1, 1, NULL, NULL, 5, 113, 19, 2, 13, 1, NULL, 1, 2, NULL, 'PND-5008092', 'I need a statement writing on my cqc registered managers application', 'I need a statement writing on my cqc registered managers application stating why I aqualung for the job as a manager the skill I have eat I can send you the form I require half a page of writing I can send u the company aims and objectives and my cv to use to write the statement aswel as the form .I\'ve sent u my cv and the company aims and objectives which should help with filling that section out yes just that section', NULL, NULL, '2022-08-28', '2022-09-08', NULL, '1', '0', 'Arial', NULL, '25.5', '20', '25.5', '0', '25.5', '21.57%', '20', '25.5', 4, 2, 0, NULL, '2022-08-28 22:29:54', '2022-09-08 23:58:17');
