(184, 1, 1, NULL, NULL, 3, 114, 15, 4, 7, 3, NULL, 27, 2, NULL, 'PND-8506135', '[Proposal Full Title and Acronym', 'Hello, \r\n\r\nThe instructions for my research proposal paper are the following:\r\n\r\nThis is the abstract:\r\n\r\n\r\nABSTRACT \r\n\r\nThe way individuals consume has altered dramatically as a result of the pandemic. In Italy and the rest of the world, the lockdown has sped up the home delivery business and e-commerce like it\'s never been done before. The digital food delivery business continues its unstoppable rise, according to the National Observatory on the Home Delivery Food Market, with a growth rate of 59% estimated in 2021,  and by 2024, an annual growth rate of 22% is predicted.  Despite a general slowdown in economic activity during the last years, several statistics indicate that e-commerce still has an opportunity to expand. As a result, new business initiatives in this industry have the potential to emerge.\r\nThis thesis is focused on the development of a business plan for the structure of a gift box delivery business startup. The business plan will assist in determining the viability of the business concept in Italy and Europe, which is based on the creation and delivery of personalized special occasion gifts. The theoretical section of the thesis investigates suitable sources and ways to define the business strategy from an academic perspective mainly focusing on the social exchange theory and the laws of motivation. The main objective is to forecast the profitability and potential of the business idea in the Italian and European market. Furthermore, different mixed methodologies were used to reveal the business concept, the targeted consumer group, and the market competition.\r\n\r\nKeywords:\r\nBusiness plan, Business idea, Start-Up, Marketing, Social exchange.\r\nhttps://www.statista.com/outlook/dmo/eservices/online-food-delivery/italy\r\n\r\nhttps://www.morganstanley.com/ideas/global-ecommerce-growth-forecast-2022\r\n\r\n\r\n\r\nThis are the guidelines for the research proposal:\r\n\r\n\r\nScientific proposal (Max characters including spaces)\r\n State-of-the-art and objectives (specify the goals as to the state- of-the -art in the relative field, indicating the related impact and level of importance - highlighting new opportunities and challenging aspects  indicate innovativeness levels)\r\n Research methodology and timelining (describe the methodology, specifying intermediate goals and stages, \'high-risk/high-gain\' balance, team members engagement)\r\n Detailed description of the research activities (including all essential information including the feasibility of the scientific proposal) (36 months max)\r\n \r\nReferences', NULL, NULL, '2022-09-04', NULL, NULL, '1', '5', 'Arial', NULL, '50.25', '50.25', NULL, '0', '50.25', '0', '50.25', '50.25', 4, 2, 0, NULL, '2022-09-02 02:20:16', '2022-09-02 03:12:24'),
(185, 1, 1, NULL, NULL, 3, 115, 14, 4, 1, 26, NULL, 50, 2, NULL, 'PND-4502078', 'Propulsion system selection for maritime autonomous surface ships', 'Master Thesis:\r\n\r\nI have two research questions:\r\nRQ 1: What are the key criteria for propulsion system selection for maritime autonomous surface ships?\r\nRQ 2: Which propulsion system is most appropriate for maritime autonomous surface ships?\r\n\r\nMethods to be used:\r\n- Delphi method to identify key criteria for propulsion system selection\r\n- Best Worst Method (BWM) Multi-Criteria decision.making (MCDM) method to analyse the most appropriate propulsion system for autonomous ships.\r\n\r\nSet up and design (also attached a template):\r\n- Times New Roman, size 12, Line spacing 1,5, margins 2,5\r\n- Between 12000 and 16000 words. \r\n- Max 10 figues, 10 tables! Typucal is 5 figures, 5 tables.\r\n\r\nI have attached the Master Thesis template and a power point of what my supervisor expects.\r\n\r\nI need a draft of the thesis by the 15th of September. Below you will find the detials that this drafts need to contain:\r\n\r\nTo be allowed to submit the master thesis, an obligatory assignment must be submitted within 3 months before the master thesis deadline (within September 15th) and approved.\r\n\r\nThe assignment is a master thesis draft that:\r\nUses the master thesis template\r\nUses APA or another given writing standard\r\nHolds an introduction chapter with research problem and/or research question(s) / hypotheses, and describes the structure of the thesis  min 3 pages\r\nHolds a literature review  min 8 pages\r\nHolds a method chapter with minimum research design and plan for data collection  min 4 pages\r\nHolds a reference list  min 20 references', NULL, NULL, '2022-09-15', NULL, NULL, '2', '30', 'Times New Roman', NULL, '591', '585', NULL, '6', '585', '0', '591', '591', 4, 2, 0, NULL, '2022-09-03 18:19:32', '2022-09-03 18:49:25'),
